export const NEXT_MOVIE = "next-movie";
export const ADD_FAV = "add-fav";

export const nextMovie = () => {
  return { type: NEXT_MOVIE };
};

export const addFav = (movie) => {
  return { type: ADD_FAV, payload: movie };
};
